// src/components/Header.js
import { Box, Flex, Link, Text } from '@chakra-ui/react';
import { FaLinkedin, FaGithub } from 'react-icons/fa';

const Header = () => (
  <Flex as="nav" justify="space-between" align="center" p="5" bg="black.400" color="white">
    <Text fontSize="2xl" fontWeight="bold">Kenneth's Portfolio</Text>
    <Flex gap="4">
      <Link href="#about" fontWeight="medium">About</Link>
      <Link href="#projects" fontWeight="medium">Projects</Link>
      <Link href="#contact" fontWeight="medium">Contact</Link>
      <Link href="" isExternal>
        <FaLinkedin size="20px" />
      </Link>
      <Link href="" isExternal>
        <FaGithub size="20px" />
      </Link>
    </Flex>
  </Flex>
);
export default Header;
